backgroundColor: '#FF6F00',
transform: [
{ scaleX: 2 }
]
}} >Change Password</button>
           
<button className="btn btn-danager col-4 ms-5  rounded-pill mb-2 " style={{
width: 350,
height: 50,
borderRadius: 140 / 2,
backgroundColor: '#FCDC00',
transform: [
{ scaleX: 2 }
]
}} >Contact Us</button>
        </tr>
        
        </div>
        </div>
    </div>
</div>




    </>
  )
}

